import React, { Component } from "react";
import "./index.css";

export default class Search extends Component {
  handleSearchUsers = () => {};
  render() {
    return (
      <section className="jumbotron">
        <h3 className="jumbotron-heading">Search Github Users</h3>
        <div>
          <input type="text" placeholder="enter the name you searching" />
          &nbsp;
          <button onClick={this.handleSearchUsers}>Search</button>
        </div>
      </section>
    );
  }
}
